INSERT INTO `Questions` VALUES (1,0,'This is the first question.','MCQ-S',1,NULL,NULL,NULL,'2021-12-28 14:27:09','2021-12-28 14:27:09',1,NULL),(2,1,'This is the second question.','MCQ-M',2.5,NULL,NULL,NULL,'2021-12-28 14:27:09','2021-12-28 14:27:09',1,NULL),(3,0,'This is the first question.','MCQ-S',1.25,NULL,NULL,NULL,'2021-12-28 14:27:09','2021-12-28 14:27:09',2,NULL),(4,0,'Questions 1 to 3 are about the following passage:\n\n-------\nCloud Computing is defined as storing and accessing of data and computing services over the internet. It doesn’t store any data on your personal computer. It is the on-demand availability of computer services like servers, data storage, networking, databases, etc. The main purpose of cloud computing is to give access to data centers to many users. Users can also access data from a remote server.\n\nWith increase in computer and Mobile user’s, data storage has become a priority in all fields. Large and small scale businesses today thrive on their data & they spent a huge amount of money to maintain this data. It requires a strong IT support and a storage hub. Not all businesses can afford high cost of in-house IT infrastructure and back up support services. For them Cloud Computing is a cheaper solution. Perhaps its efficiency in storing data, computation and less maintenance cost has succeeded to attract even bigger businesses as well.\n\nCloud computing decreases the hardware and software demand from the user’s side. The only thing that user must be able to run is the cloud computing systems interface software, which can be as simple as Web browser, and the Cloud network takes care of the rest. We all have experienced cloud computing at some instant of time, some of the popular cloud services we have used or we are still using are mail services like gmail, hotmail or yahoo etc.\n\nWhile accessing e-mail service our data is stored on cloud server and not on our computer. The technology and infrastructure behind the cloud is invisible. It is less important whether cloud services are based on HTTP, XML, Ruby, PHP or other specific technologies as far as it is user friendly and functional. An individual user can connect to cloud system from his/her own devices like desktop, laptop or mobile.\n-------\n\nQ1: In cloud computing, data is stored on','MCQ-S',1,NULL,NULL,NULL,'2021-12-28 14:37:37','2021-12-28 14:37:37',3,NULL),(5,1,'To access cloud computing, the user must be able to access a','MCQ-S',1,NULL,NULL,NULL,'2021-12-28 14:37:37','2021-12-28 14:37:37',3,NULL),(6,2,'The technology infrastructure behind the cloud platform is ','MCQ-S',1,NULL,NULL,NULL,'2021-12-28 14:37:37','2021-12-28 14:37:37',3,NULL),(29,0,'Read the following passage. Then, decide whether the statements in Questions 1-3 are valid assumptions supported by the passage or not.\n\n-------\nDuring the 2000s, the number of soldiers physically stationed in the Middle-East skyrocketed. However, in 2019, this number is continuing to decease. It’s wonderful that the western world has less of a military presence in other countries, presumably to a negligible amount on the next 5 to 10 years.\n-------\n\nStatement 1: No soldiers physically stationed in an area means that there is less of a military presence.','MCQ-S',1,'/img/external-content.duckduckgo.com.jpg-1640782690960.jpeg',NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(30,1,'Statement 2: There won’t be another spark of conflict within the next 5 to 10 years.','MCQ-S',1,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(31,2,'Statement 3: War is a thing of the past.','MCQ-S',1,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(32,3,'Read the following passage. Then, decide whether the three statements in Questions 4-6 are “True”, “Probably True”, “Insufficient Data to Say True or False”, “Probably False”, or “False” – based purely on the information in the text.\n\n-------\nJohn’s company has been successful for the past 5 years. Reported profits have been rising each year, with 2018 being the strongest year yet. To celebrate, John treated his staff to a meal at a 5-star restaurant in the city.\n-------\n\nStatement 1: John is rich','MCQ-S',1.5,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(33,4,'Statement 2: John\'s staff are happy','MCQ-S',1.5,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(34,5,'Statement 3: John’s company performed well in 2017.','MCQ-S',1.5,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(35,6,'The median house value in Butlerville has fallen significantly in the last few months. Nonetheless, the number of homes sold has been at its lowest level in seven years.\n\nWhich of the following best explains the discrepancy?','MCQ-S',3,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',9,NULL),(36,0,'Questions 1-2 are about the following passage:\n\n-------\nAn anomaly which often struck me in the character of my friend Sherlock Holmes was that, although in his methods of thought he was the neatest and most methodical of mankind, and although also he affected a certain quiet primness of dress, he was none the less in his personal habits one of the most untidy men that ever drove a fellow-lodger to distraction. Not that I am in the least conventional in that respect myself. The rough-and-tumble work in Afghanistan, coming on the top of a natural Bohemianism of disposition, has made me rather more lax than befits a medical man. But with me there is a limit, and when I find a man who keeps his cigars in the coal-scuttle, his tobacco in the toe end of a Persian slipper, and his unanswered correspondence transfixed by a jack-knife into the very centre of his wooden mantelpiece, then I begin to give myself virtuous airs. I have always held, too, that pistol practice should be distinctly an open-air pastime; and when Holmes, in one of his queer humors, would sit in an arm-chair with his hair-trigger and a hundred Boxer cartridges, and proceed to adorn the opposite wall with a patriotic V. R. done in bullet-pocks, I felt strongly that neither the atmosphere nor the appearance of our room was improved by it.\n-------\n\nQ1: The narrator of this paragraph is','MCQ-S',2.5,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',10,NULL),(37,1,'Sherlock Holmes, according to the passage, was','MCQ-S',2,NULL,NULL,NULL,'2021-12-29 13:31:49','2021-12-29 13:31:49',10,NULL),(38,2,'Questions 3-5 are about the following passage:\n\n-------\nSome are insisting on retaining the old ways. One morning show host, with a fickleness typical to the category, announced the other day that people should fill cinema halls and support the flailing local industry — I suppose even if it means becoming numbers in a pandemic of an airborne virus. Those numbers, the gift of Omicron, are not simply rising; they are skyrocketing. According to the US Centres for Disease Control, America alone is supposed to reach a million cases of Covid-19 a day by mid-January — this in a country where 61 per cent of the population has been double vaccinated and many have received a booster dose of the most effective Pfizer and Moderna mRNA vaccines.\n\nCloser to home, the situation in China is also expected to be dire. A study that was done in Hong Kong recently revealed that even three doses of the popular SinoVac vaccine do not provide immunity against the Omicron strain. The Sinopharm vaccine has also been found to have lower efficacy against Omicron. It is not surprising that a few days ago the Chinese reported the greatest daily surge in several months in cases of the Omicron variant. This has particular relevance for Pakistan, where weddings, social gatherings, offices and educational institutions have all gone back to functioning as normal.\n\nGiven all these facts and realities, none of which are likely to change in the near future, 2022 requires ’re-conceptualisations’ rather than resolutions. Constant school closures 